(11074, 8753, 0, 1, 'sorry(demo)', '每當夜晚想創作時,就開始失眠\r\n\r\n除了戴耳機以外,一不小心吼太大聲就會遭到鄰居的抗議\r\n\r\n於是常常被敲門中止錄音\r\n\r\n這首歌是每次遇到這件事的感覺\r\n\r\n此首為demo版本', '0000-00-00 00:00:00', 0000, 0, 1, 9, '殘餘力氣的手指,撥開聲音的限制.\r\n\r\n不安份的血液因子\r\n\r\n佔據大腦的位置\r\n\r\n\r\n瘋狂,吵鬧,停止,睡覺x4\r\n\r\nNo\r\n\r\n上帝贈送的靈感和遭受襲擊的門\r\n\r\n沒有選擇的規則,因害怕服從的人\r\n\r\n瘋狂,吵鬧,停止,睡覺x4\r\n\r\nsorry,sorry,sorry這不是我的本意\r\n\r\nshut it,shut it,shut it,這對我沒有意義\r\n\r\n瘋狂,吵鬧,停止,睡覺x4', '', 248, '', '江民凱', '江民凱', 'RJ45', '暫無', '', 0, 1, 0, '2008-12-24 17:59:05', '2015-03-12 13:36:04', '0000-00-00 00:00:00'),
